Listing.where(vin: 'WP0AF2A95GS192106').first.update(:title=>"2016 Porsche 911", :description=>"Our Clean CarFax 2016 Porsche 911 GT3 Coupe, in Lava Orange with a Black/Lava Orange leather interior, boasts iconic world-class sports car attributes and commands absolute attention with its exotic growl, exceptional performance and confident attitude. Powering our coupe is a 4.0 Liter Flat 6 Cylinder that unleashes 475hp to an innovative 7 Speed Automatic PDK transmission with Rear Wheel Drive. You'll love the exhilarating rush in this immaculate performance machine as you blast to 60mph in under 3 seconds and achieve 20mpg on the highway. The exterior is highlighted with a wing spoiler! Over 50 years of meticulous German engineering have gone into making our 911 GT3 an excellent performer as well as an extremely comfortable ride. The highly refined cabin features superior materials and a plethora of top-shelf amenities as seen in our photos. Imagine yourself fulfilling your automotive fantasies with this beauty - whether commuting in traffic, driving the back roads or cornering on a local track, there is just nothing like driving a Porsche! You'll feel self-assured with the exceptional build quality, strong brakes and advanced safety measures that have been incorporated into the design of this phenomenal machine. Livable, stylish, and immensely fun to drive, you owe it to yourself to feel this raw power in the flesh. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer 