Listing.where(vin: '1GYS4BEF3CR143623').first.update(:title=>"2012 Cadillac Escalade", :description=>"Our One Owner, Clean CarFax 2012 Cadillac Escalade Luxury AWD, shown in Black Ice Metallic with an Ebony leather interior, will change your life. Cadillac maintains its reputation for space and capability, as well as prestige and superiority on the road with its 6.2 Liter V8 boasting 403hp and space for eight passengers. The 6 Speed Automatic transmission in this All Wheel Drive provides an amazingly smooth ride and 18 mpg on the highway. Luxury adds beautiful black wheels, luggage rack, power liftgate, running boards, tow hooks, trailer towing package, a magnetically controlled adaptive suspension and automatic high beams. Luxury adds DVD, sunroof, navigation, remote start, keyless entry, heated and cooled front seats, heated 2nd-row seats, memory seat, Bose audio with Bluetooth connectivity, power flip-and-fold second-row seats and a heated steering wheel. The smooth driving experience continues with the Escalade's relaxing interior jam-packed features shown in our pictures. Enjoy a plethora of safety features, starting with StabiliTrak Electronic Stability Control System with ABS, rear parking aid, adjustable pedals, BLIS and well-placed airbags. Come get the vehicle that has been America's dream SUV for years, the Cadillac Escalade. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer that all details listed are accurate. The dealership is not responsible for typ