Listing.where(vin: '1FTFW1R62EFA52269').first.update(:title=>"2014 Ford F-150", :description=>"From the genius people that made SVT Cobra, our One Owner, Clean CarFax 2014 Ford F-150 SVT Raptor SuperCrew 4x4 is displayed in an incredible Tuxedo Black Metallic with a Black W/Blue leather interior! Powered by a massive 6.2 Liter V8 that supplies 411hp while connected to a robust 6 Speed Automatic transmission with Ford's Tow/Haul mode and Four Wheel Drive. Expect 16mpg on the highway from this stout machine along with an aggressive ride thanks to the high-performance off-road Fox Racing Shox set up with unique alloy wheels, running boards, tonneau cover and tow hooks! Besides the colossal stance, flared fenders, and performance everything... Inside, F-150 SuperCrew is all SVT with unique badging, keyless entry, keypad, sunroof, dual climate controls, MyFord, power seating, thumping sound system with steering wheel controls, and plenty of off road mode switches. Accommodation is plentiful, and the four doors make room for all your gear. Just because this is a big and beefy terrace jumping machine doesn't mean that Ford is light on safety. This specialty vehicle benefits from all the great features that have helped Ford lead the charge with an onboard safety like multiple airbags including thorax, AdvanceTrac with roll stability control, reverse parking aid and even shift on the fly to make this tops in its class. So stop dreaming and start driving. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsib