Listing.where(vin: '1J4NF1FB9BD210489').first.update(:title=>"2011 Jeep Compass", :description=>"Climb aboard this Clean CarFax 2011 Jeep Compass Latitude 4WD, in Bright White, and you'll be impressed at the amount of room inside! Powered by a 2.4 Liter 4 Cylinder Automatic transmission, this Four Wheel Drive Compass has no problems getting up to speed or passing the gawkers out for a Sunday drive. And, you can even pass up the gas station a few extra times, thanks to the EPA rating of 28mpg on the highway! You'll be saving money the minute you drive this Compass off our lot! The exterior is highlighted with roof rails. Every seat is comfortable and gives you a nice view of the road ahead. Even though this one has cloth upholstery you still get spoiled with heated front seats, cargo shade and keyless entry! This Jeep comes standard with dual front and curtain side airbags, anti-lock four-wheel disc brakes with brake assist, anti-skid, traction control, and a tire pressure warning system. Packed with comfort and safety features galore, this Compass is ready to meet your needs and exceed your expectations! You've gotta give this one a try! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer that all details listed are accurate. The dealership is not responsible for typographical, pricing, product information, advertising or shipping errors. Advertised prices and available quantities are subject to change without notice. All rates and offers are dependent on bank appro