Listing.where(vin: '1FT7W2B69HEC65153').first.update(:title=>"2017 Ford Super Duty F-250 SRW", :description=>"Appreciate the heavy duty stamina and handsome good looks of our One Owner, Clean CarFax 2017 Ford F-250 Lariat Crew Cab 4WD that's tougher than ever before in Oxford White with a Gray leather interior! This Four Wheel Drive brute helps you take charge of your toughest days with its robust 6.2 Liter V8 with 430lb-ft of torque and 385hp. Shifting is seamless with our innovative 6 Speed Automatic transmission and delivers massive payload and towing capability that will meet and exceed your demands. There's no mistaking the F-250 Lariat as it powers down the road with a commanding stance, trailer towing package, tow hooks and that distinct chrome 2-bar-style grille. The cabin is set-up to help you take your day to the next level with everything perfectly in place including key-less entry, power locks/windows, a power sliding rear window and an LCD productivity screen. You'll feel as though you can take on anything behind the wheel snug in your highly adjustable leather-trimmed seat, a leather-wrapped steering wheel, and Sync 3 touchscreen with voice-activated technology that helps you keep your eyes on the road and your hands on the wheel so you can maintain that ever-important connection. Buckle up, turn on your favorite tunes courtesy of the Premium Sony AM/FM/CD audio system with available satellite radio, and enjoy the ride! The fully boxed high strength steel frame of our F-250 provides peace of mind along with SOS post-crash alert, MyKey, parking sensors, anti-lock brakes, stability/traction control, trailer sway control, and more. This truck is smart, capable, and impressive! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all pr