Listing.where(vin: '1FTFW1ET3DKF12542').first.update(:title=>"2013 Ford F-150", :description=>"Meet our One Owner, Clean CarFax 2013 Ford F-150 XL SuperCrew 4WD shown in brilliant Tuxedo Black Metallic. This handsome truck starts with a get it done attitude. A Twin Turbo 3.5 Liter EcoBoost V6 that offers 365hp on demand while paired with a 6 Speed Automatic transmission w/Tow/Haul Mode you will have no problem pulling in 21mpg on the highway while enjoying a smooth and quiet ride. Our Ford Tough F-150 is one of the top-selling full-size trucks on the market today due to its reliability and performance. Best in class towing and payload capabilities make this functional but it's a darn good looking truck too! Who would have thought Turbo and Four Wheel Drive went together like this. Ford has a winner here! The exterior is highlighted with black wheels, FX4 package, tailgate step, spray in liner, tow hooks and a trailer towing package. Inside you can expect the same durability and style with SuperCrew, rear sliding window and keyless entry. You will find comfortable seating for your crew with an easy to read display center and great storage spaces. With this XL, you are good to go with a superb, reliable truck for a great price! Ford always comes through with safety and F-150 ranks at the top. Its high strength steel safety cage keeps you secure along with six standard airbags, SOS post crash Alert, Trailer Sway and Roll Stability control and anti-lock brakes. F-150 has everything you could ask for in a full-size truck. Whether it's for work or play you have made an excellent choice! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that 