Listing.where(vin: '1C4HJWEG6DL671072').first.update(:title=>"2013 Jeep Wrangler Unlimited", :description=>"Take a look at one of the most widely recognized terrain busting, four-door vehicles in the world. Our Clean CarFax 2013 Jeep Wrangler Unlimited Sahara 4WD, shown in a Black with a Gray interior, is ready to handle everything thrown its way. Powered by 3.6 Liter V6 that offers 285hp and almost as much torque while combined with the rock-solid Dana axles and a 5 Speed Automatic transmission allow you to maintain civility or let you carve your path where ever you see fit. The Four Wheel Drive Sahara goes a little beyond basic by offering black wheels, body colored fender flares, tow hooks and tubular side steps for easier access. With city streets and freeways providing an increasingly unfriendly atmosphere to standard, car-based suspensions, large tires and real ground clearance are increasingly handy for the committed urbanite. Stepping in or out of most potholes does nothing more than spill your drink. New for this year is the upgraded interior lighting, making it easier to climb in even on the moonless nights. If you get the urge to take an open-air cruise, just remove the top, put on some shades, crank up the seven Alpine speaker sound system, and hit the road! A secure safety cage surrounds you, multistage airbags protect you, and Hill-start and stability control help you along the way. Our Sahara offers all of the legendary rock-climbing ability of America's favorite off-roader, with a dose of comfort to go along for the ride! Print this page and call us Now...We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort 