Listing.where(vin: '5N1AR2MN0EC685226').first.update(:title=>"2014 Nissan Pathfinder", :description=>"Offering a brilliant blend of utility, style, and innovation, our top-of-the-line One Owner, Clean CarFax 2014 Nissan Pathfinder Platinum SUV in Brilliant Silver is everything you need in a family-friendly SUV! Powering this machine is a 3.5 Liter V6 that extends 260hp which is paired with Nissan's Xtronic CVT transmission and Front Wheel Drive. This incredible combination scores near 26mpg on the highway and allows up to 5,000 pounds in towing capability. Our Platinum is a handsome machine; exuding understated elegance paired with the perfect hint of athleticism with its gleaming alloy wheels, rear spoiler and roof rack! Open the door to find heated and ventilated leather seats, a fully-customizable advanced drive-assist display and keyless entry. You'll stay connected via Bluetooth, Bose touchscreen audio, Even with all three rows occupied, you can still manage to fit up to 16 cubic feet of cargo! Add wood grain interior trim, leather steering wheel, cargo mat, dual climate controls and DVD entertainment system. Of course, meticulously designed safety features are in place to keep you and your passengers safe from harm as you make your way in your Pathfinder. Practically perfect, this SUV is calling your name! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer that all details listed are accurate. The dealership is not responsible for typographical, pricing, prod