Listing.where(vin: '5NPDH4AE3FH607436').first.update(:title=>"2015 Hyundai Elantra", :description=>"Nimble and light on its feet with sporty sophistication, our incredible One Owner, Clean CarFax 2015 Hyundai Elantra Limited Sedan is shown in a gorgeous Quartz White Pearl exterior finish. Under the hood of this stylish sedan, you'll find the highly efficient 1.8 Liter 4 Cylinder that extends 148hp and is mated to the smooth-shifting 6 Speed Automatic transmission and Front Wheel Drive. Together, they not only make the drive fun and enjoyable, but they also provide up to 37mpg on the highway; further proving efficiency and style can coexist! Our upscale 5-passenger family-friendly Limited sedan has an athletic stance that is accented by stylish alloy wheels, projector headlights with LED accents, LED taillights and a black chrome grille. Our pictures show how sophistication continues into the roomy and well-designed interior. Experience high-quality soft-touch materials in the content-rich interior with heated front leather seating and power driver's seat. Our premium audio system features a color touchscreen display plus iPod/USB capabilities for your tunes. Imagine yourself behind the wheel in this machine... Enjoying your commute! With six airbags, vehicle stability management as well as anti-lock brakes, the Elantra has been named a top safety pick by the IIHS. With enough authentic style and phenomenal efficiency to please the harshest of critics, our Elantra has taken not only the compact class but the whole world by storm. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provi