Listing.where(vin: '2G4WD582361279941').first.update(:title=>"2006 Buick LaCrosse", :description=>"This One Owner Clean Carfax 2006 Buick LaCrosse presents a five-passenger mid-size vehicle that handles like a dream. It was engineered to offer an agreeable balance between a supple ride and confident handling  The CXL comes with the 3.8-liter V6, that makes 200-hp that's paired with an automatic transmission that generates 230 lb-ft of torque. On the highway, it rides smoothly and soaks up bumps with little drama, as you'd expect a mid-sized family sedan to do. Fuel efficiency is rated at 17/28 mpg (city/highway).   Drivers are attracted to this Buick's hushed cabin, simple controls, plush ride and peppy performance. With its stately grille and shapely body, this LaCrosse is attractive without being gaudy. Our upscale CXL trim adds alloy wheels, leather upholstery, wood grain trim, heated front seats and a driver seat power lumbar adjustment. The dash design is clean and elegant, with a long expanse of faux wood trim sweeping across its length, interrupted only by a simple gauge cluster located directly in front of the driver.   Our Buick LaCrosse features standard full-length side curtain airbags, and anti-lock disc brakes. In government frontal-impact crash tests, the Buick LaCrosse earned five stars (out of five) for driver and front-passenger protection. Print this page and call us NOW for your personalized test drive towards ownership. We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.  END OF MARCH BOTTOM LINE CASH DEALS PRICES EXPIRE APRIL 1ST NO FOOLIN", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2006, :miles=>69485, :transmission=>"Automatic", :color=>"Sandstone Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>69