Listing.where(vin: '3A8FY58BX8T186515').first.update(:title=>"2008 Chrysler PT Cruiser", :description=>"Stylish and fun, our 2008 Chrysler PT Cruiser Touring Wagon offers the retro look and solid performance that you are looking for shown in Bright Silver Metallic. Powered by Chrysler's reliable 2.4 Liter 4 Cylinder generating 150hp mated to a 4 Speed Automatic transmission. This Front Wheel Drive offers a smooth fun ride with plenty of passing power as it secures near 24mpg on the open road. The stylish exterior shows off a recognizable stance enhanced with fog lamps, alloy wheels, and privacy glass.  The Touring trim brings you lots of popular features including comfortable cloth seats, keyless entry, power accessories, cruise control and a great sounding AM/FM/CD stereo. For your convenience and added versatility, the trunk area expands when the rear seats are folding down giving you plenty of cargo room for your belongings.   For your safety, Chrysler included an array of airbags, child safety locks, a tire pressure monitor, and more. Scan our pictures and feature lists of this sleek retro machine and then... Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2008, :miles=>87409, :transmission=>"Automatic", :color=>"Bright Silver Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>5999, :newused=>"Used", :vin=>"3A8FY58BX8T186515", :stocknumber=>"CCSJ098", :model=>"PT Cruiser", :trim=>"Touring", :enginedescription=>"2.4L 4 Cylinders", :interiorcolor=>"Pastel Slate Gray", :options=>"28P Touring Signature Series Customer Preferred Order Selection Pkg,65/35 Split Fold/Tumble/Removable Rea