Listing.where(vin: '3C3AY75S25T335100').first.update(:title=>"2005 Chrysler PT Cruiser", :description=>"Own a piece of time with our 2005 Chrysler PT Cruiser GT Convertible in Blue over Grey interior! This PT Cruiser's heartbeat comes from a Turbo Charged 2.4 Liter 4 Cylinder coupled to an Automatic transmission that delivers 220hp. This sassy little GT's 0 to 60 time, at 6.7 seconds, is more than four seconds quicker than the base engine models.\u00C2\u00A0   Owners love the ride of these PT Cruisers. Funny to say but it cruises like a dream! Check out the GT upgrades on this one! Check out our photos and list of features! Let the top down, sit back in the leather seats, hang on and get ready for some real fun!\u00C2\u00A0   Feel Safe behind the wheel with the long list of safety features! Print this page and call us Now... We Know You Will Enjoy You're Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2005, :miles=>68037, :transmission=>"Automatic", :color=>"Electric Blue Pearl", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>5999, :newused=>"Used", :vin=>"3C3AY75S25T335100", :stocknumber=>"ACSJ208", :model=>"PT Cruiser", :trim=>"GT", :enginedescription=>"2.4L 4 Cylinders", :interiorcolor=>"Dark Slate Gray", :options=>"Audio : Cd Player,Auxiliary Front/Rear/Center Console Pwr Outlets,Convenience : Adjustable Steering Wheel,Convenience : Fog Lamps,Convenience : Front Reading Lamps,Convenience : Intermittent Wipers,Convenience : Leather Steering Wheel,Convenience : Power Outlet,Convenience : Remote Trunk Release,Convenience : Security System,Convenience : Universal Garage Door Opener,Locks : Keyless Entry,Locks : Power Door Locks,Universal Garage Door Ope