Listing.where(vin: '3C8FY4BB61T593763').first.update(:title=>"2001 Chrysler PT Cruiser", :description=>"Our 2001 PT Cruiser Wagon with Clean Carfax combines the retro look of late-'30s American iron with modern performance, efficiency and features. It blends the retro look of the early American sedan with new-age styling cues such as dual-beam flush headlights and teardrop-shaped taillight lenses.\u00C2\u00A0 This baby has leather seats, power sunroof, AM/FM stereo, CD player, cassette, and full floor carpeting!  This 4-door model's tall body boasts lots of room for people and cargo. In fact, its interior volume and versatility compare well to a small SUV. Fold the seats down and you can carry an eight-foot ladder.\u00C2\u00A0 Pull the rear seats out and you can haul a load of building materials or a big-screen TV.\u00C2\u00A0 Yet our PT Cruiser is small and easy to park. It's also easy on gas.  Our Cruiser is a great choice for people of all ages and lifestyles with its whimsical, retro design and functional attitude. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2001, :miles=>98030, :transmission=>"Automatic", :color=>"Stone White", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>3999, :newused=>"Used", :vin=>"3C8FY4BB61T593763", :stocknumber=>"ACSJ118", :model=>"PT Cruiser", :trim=>nil, :enginedescription=>"2.4L 4 Cylinders", :interiorcolor=>"Gray", :options=>"Air Conditioning : A/C,Air Conditioning W/Front & Rear Outlets,Audio : Am/Fm Stereo,Child Seat Anchor System,Convenience : Intermittent Wipers,Convenience : Power Outlet,Driver/Front Passenger Next Generation Airbags,Instrument Cluster W/Tachometer,Pwr Windows W/Driver & Front Passenger 1-Touch Down,Rear Door Child Protection Locks,Rear Window Defroster,Seats : Bucket Seats,Steering : Power Steering,Window : Power Windows,Window : Rear Defrost", :imagefront=>nil, :imageback=>nil, :imageleft=>nil, :imageright=>nil, :frontinterior=>nil, :rearinterior=>nil, :bodytype=>"Hatchback", :make=>"Chrysler", :approved=>true, :expiration_date=>"2218-01-03 01:44:43", :external_url=>true, :external_image=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176106/20180205182005655_f7158a37c5d4496989f7091222c0eeb5.jpg", :external_imagefront=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176106/20180205182005994_2a15b6330c6c4cc0bd9162526301af3d.jpg", :external_imageback=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176106/20180205182006473_cf514a68a67944a5984680595f1aee40.jpg", :external_imageleft=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176106/20180205182006746_6815c7646174466c955f9ae5ee8c2dea.jpg", :external_imageright=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176106/20180205182006950_a06a83898ff14febb05a6e5cfde0e711.jpg", :external_frontinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176106/20180205182007182_2fd303738cce489289bf25058de49c90.jpg", :external_rearinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176106/20180205182007350_ea4eb40c3e0e4f59a3dd005ce87c376a.jpg")
Listing.where(vin: '1C3CDZAB1DN643427').first.update(:title=>"2013 Dodge Avenger", :description=>"Our athletic Clean CarFax 2013 Dodge Avenger SE shown in Redline 2-Coat Pearl over light interior offers a bold, muscle car-like look to the mid-size sedan buyer like you. Powered by a proven 2.4 Liter 4 Cylinder offers 173hp while tethered to a responsive Automatic transmission that offers smooth shifts and plenty of passing power. The suspension on this Front Wheel Drive is taut and the road is dampened with sound deadening elements from the factory for a richer ride down the road while seeing near 31mpg.\u00C2\u00A0   Slip inside this family sedan that is cleverly disguised as a muscle car and you will be greeted by ambient lighting and a premium soft-touch interior. Features abound in the Avenger offer plenty of happiness for everyone!\u00C2\u00A0   Dodge has loaded this one up with safety features to put your mind at ease. Included in our Avenger are plenty of airbags plus Electronic Stability Control system with traction control and anti-lock brakes. It is even an IIHS top safety pick and like all Dodge, products have exceptional value in the safety department. If you've got dreams of driving a muscle car, but need a car for the whole family, our Avenger SE is the most brute looking option you'll find. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!   \u00C2\u00A0We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.\u00C2\u00A0     END OF MARCH BOTTOM LINE CASH DEALS PRICES EXPIRE APRIL 1ST NO FOOLIN", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2013, :miles=>80080, :transmission=>"Automatic", :color=>"Maroon", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>8899, :newused=>"Used", :vin=>