Listing.where(vin: '1B3HB28B68D655705').first.update(:title=>"2008 Dodge Caliber", :description=>"With its bold, aggressive styling, our 2008 Dodge Caliber SE certainly knows how to make an entrance!\u00C2\u00A0 Our 2008 Caliber SE boasts a 2.0 Liter 4 Cylinder, replacing a previous 1.8 Liter option, with an Automatic transmission. This one is peppy and fun!  The instrument panel, console, central storage bin and armrest, and other elements have been entirely redesigned. The re-do includes soft-touch materials, bright accents throughout the interior, and cup-holders illuminated by LED lighting. Our Caliber is loaded with special features, take a look at our photos to see all that our SE has to offer! This is one fine machine!\u00C2\u00A0   How badly do you need a comfy and safe family hauler? I think we know the answer to that question...\u00C2\u00A0 Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2008, :miles=>109238, :transmission=>"Automatic", :color=>"Pewter", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>5499, :newused=>"Used", :vin=>"1B3HB28B68D655705", :stocknumber=>"AAYJ128", :model=>"Caliber", :trim=>"SE", :enginedescription=>"2L 4 Cylinders", :interiorcolor=>"Black", :options=>"Air Bag - Frontal : Passenger Air Bag Sensor,Audio : Am/Fm Stereo,Audio : Cd Player,Auxiliary 12V Pwr Outlet,Child Protection Rear Door Locks,Convenience : Intermittent Wipers,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Outside Temp Display In Odometer,Rear Seat Heat Ducts,Rear Window Defroster,Safety Features : Child Safety Locks,Sentry Key Theft Deterrent System,Sliding Armrest,Window : Rear Defrost", :imagefront=>nil, :imageback=>nil, :imageleft=>nil, :imageright=>nil, :frontinterior