Listing.where(vin: '1B4GP44L7XB815846').first.update(:title=>"1999 Dodge Caravan", :description=>"There is no end to the praise for Our One Owner Clean Carfax 1999 Deep Cranberry Pearl Grand Caravan SE. From its trim options, to the smooth, quiet ride and car-like driving experience, to the cargo space and energetic engine, this minivan maintains its popularity. Drivers love.......well, they love everything. It has a very appealing and satisfying engine response with its lively acceleration from a standstill with the 3.8L V6 with 180hp while earning 25mpg highway. This 4-Speed automatic with Front Wheel Drive is quiet running, has light-touch handling, and provides excellent highway performance, with - might I just add - a Very Strong safety rating. Get the picture?  This SE trim does nearly everything correctly. Exceptional seat comfort, roomy interior, seating for 7, excellent dashboard controls, and up-high seating for great visibility! ABS, child-protection sliding side-door locks, and steel door beam side-impact protection keep all the peeps secure.  This Grand Caravan SE is especially easy to drive and easy to enjoy. No shopper should buy a minivan without giving this one serious consideration. Test drive it today! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>1999, :miles=>124131, :transmission=>"Automatic", :color=>"Deep Cranberry Pearl", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>3995, :newused=>"Used", :vin=>"1B4GP44L7XB815846", :stocknumber=>"ECSJ117", :model=>"Caravan", :trim=>"SE", :enginedescription=>"3.8L 6 Cylinders", :interiorcolor=>"Mist Gray", :options=>"3Rd Row Cent