Listing.where(vin: '1FAHP3H26CL353924').first.update(:title=>"2012 Ford Focus", :description=>"Meet our luxurious 2012 Ford Focus SEL offered in sparkling Sonic Blue. Under the hood of this upscale sedan is a peppy 2.0 Liter 4 Cylinder that offers 160hp on demand while tethered to a smooth shifting 6 Speed Automatic transmission. This ideal combination helps you achieve near 38mpg on the open road. You love the European look, marvel at the handling characteristics and will want to add this to your family today.   Our Focus SEL has an attractive interior that offers comfortable bucket seats, leather wrapped steering wheel, dual zone temperature control, and incredible ambient lighting. Voice activated SYNC allows you hands free communication and entertainment that integrates with your smart phone, it even reads your texts out loud!  Safety is top of mind with Fords Focus Sedan as you take advantage of over 100 years of innovation. Start with Ford's exclusive MyKey. Owner controls let parents set features such as speed and volume control to keep teen drivers safe along with AdvanceTrac electronic stability control for all weather conditions, anti-lock brakes for all road surfaces and six airbags just in case. These standard features make the Focus one of the safest small cars on the market today. You can't help but smile all the way to the bank when you realize all you get with our Ford Focus. It may be one of the smartest choices you've made this year! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!  \u00C2\u00A0We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2012, :miles=>114725, :transmission=>"Automatic", :color=>"Sonic Blue Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2