Listing.where(vin: '4JGAB72EXYA184882').first.update(:title=>"2000 Mercedes-Benz ML430", :description=>"Our Clean Carfax Mercedes-Benz  ML430 4WD, is stunning in Brilliant Silver.\u00C2\u00A0 Our ML430 Four Wheel Drive has a powerful 4.3 Liter V8 that delivers an excellent balance of the rugged looks, room, security and utility that SUV buyers seek.  Inside and out, there's more than a hint of minivan in the styling. The M-Class is purposeful and compact in appearance, with a sculpted front end and sharply sloped hood. Still, this SUV has traditional body-on-frame construction. Familiar Mercedes-Benz touches are obvious inside. The seats are wide, yet supportive, with thick, sturdy leather upholstery and more than enough bolstering for SUV driving. Ours even has a sunroof, and CD changer!  There aren't many vehicles that can carry five passengers to an upscale restaurant downtown, or up the hill to a hideaway in the woods, with the same degree of comfort, luxury and style. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2000, :miles=>181688, :transmission=>"Automatic", :color=>"Brilliant Silver", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4599, :newused=>"Used", :vin=>"4JGAB72EXYA184882", :stocknumber=>"BAVQ168", :model=>"ML430", :trim=>"SUV", :enginedescription=>"4.3L 8 Cylinders", :interiorcolor=>"Charcoal", :options=>nil, :imagefront=>nil, :imageback=>nil, :imageleft=>nil, :imageright=>nil, :frontinterior=>nil, :rearinterior=>nil, :bodytype=>"SUV", :make=>"Mercedes-Benz", :approved=>true, :expiration_date=>"2218-01-03 01:44:43", :external_url=>true, :external_image=>"http://images.dea