Listing.where(vin: '4A3AC84H03E078406').first.update(:title=>"2003 Mitsubishi Eclipse", :description=>"Mitsubishi says the Eclipse symbolizes what the brand is all about: style, fun, performance, and value. One look at our Clean Carfax 2003 Mitsubishi Eclipse GT in                                                                            Titanium Pearl                                                                         and we think you will agree. This is one of the most reasonably priced sporty cars on the market. The fun per dollar quotient is high and in today's climate, this is a key component to an ongoing smile.  On the road our Eclipse GT offers a smooth ride with a 3.0 Liter V6 keeps the driver feeling connected with the road rather than feeling isolated like in other like size sporty cars. Give it a wide-open highway or a twisty country two-lane and the Eclipse handles well from solid acceleration to straight-line stopping power. With the sunroof open, the windows down and the tunes rocking you will be the coolest one you know.  Not only is this Eclipse a more sophisticated alternative to a Detroit pony car, it is also a serious challenger to some much more expensive European models. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2003, :miles=>106085, :transmission=>"Manual", :color=>"Titanium Pearl", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4599, :newused=>"Used", :vin=>"4A3AC84H03E078406", :stocknumber=>"CAVQ168", :model=>"Eclipse", :trim=>"GT", :enginedescription=>"3L 6 Cylinders", :interiorcolor=>"Midnight", :options=>"(2) 12-Volt Pwr Outlets,3-Point Seatbelts For All Seating Positions W/Height-Adjustable Front Shoulder Belt Anchors,Air Conditioning : A/C,Audio : Cd Player,Convenience : Leather Steering Wheel,Convenience : Power Outlet,Convenience : Remote Trunk Release,Convenience : Variable Speed Intermittent Wipers,Dual Front Airbags,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Mirrors,Pwr Windows,Tether Anchors For Upper Portion Of Child Seat,Vehicle : Rear Spoiler", :imagefront=>nil, :imageback=>nil, :imageleft=>nil, :imageright=>nil, :frontinterior=>nil, :rearinterior=>nil, :bodytype=>"Coupe", :make=>"Mitsubishi", :approved=>true, :expiration_date=>"2218-01-03 01:44:43", :external_url=>true, :external_image=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/194328/20180330000942986_DSC_2336.jpg", :external_imagefront=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/194328/20180330000946384_DSC_2337.jpg", :external_imageback=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/194328/20180330000936249_CCF08092017%20-%20Copy.jpg", :external_imageleft=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/194328/20180330000939662_DSC_2338.jpg", :external_imageright=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/194328/20180330000950089_DSC_2339.jpg", :external_frontinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/194328/20180330000953565_DSC_2340.jpg", :external_rearinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/194328/20180330000957036_DSC_2341.jpg")
Listing.where(vin: '5N1AN08UX7C508526').first.update(:title=>"2007 Nissan Xterra", :description=>"Our '07 Xterra\u00C2\u00A0 is the genuine article: a real, Safari-grade adventure vehicle that can still handle everyday life on pavement with refinement and ease. Like its big brother, the Nissan Pathfinder, the Xterra is substantial, sophisticated, and refined. From its uncles, Titan and Armada, it has inherited a well-engineered, fully boxed ladder frame. Sophisticated electronics help maintain traction and stability over all kinds of uncertain terrain. Power comes via a 4.0-liter version of Nissan's acclaimed VQ V6 used in the 350Z, its fast living Nissan sister.  This Xterra is roomy inside, roomier than other SUVs in its class. It would work great for carrying four large adults and their gear into the backcountry. Second-row seating is stadium-style, meaning that the rear passengers can see over the front-seat occupants.\u00C2\u00A0 This is an S trim model, so some extras are on board (in addition to the long list of standard features) including running boards and roof rack cross bars.\u00C2\u00A0\u00C2\u00A0   There is nothing else quite like an Xterra. It's in its element when used as a truck, a dirt-road prowler, or an adventure vehicle. It can handle wet or dirty cargo and clean up like a champ.\u00C2\u00A0\u00C2\u00A0 Our '07 is considerable improved over pre-2005 models with more power, more room, and more carefully thought-out utility features. It's built on a rugged chassis. Yet it's more refined in every way, making it a much more practical everyday vehicle\u00C2\u00A0 that you will enjoy 24/7/365.\u00C2\u00A0 Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! END OF MARCH BOTTOM LINE CASH DEALS PRICES EXPIRE APRIL 1ST NO FOOLIN", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2007, :miles=>109597, :transmission=>"Automatic", :color=>"Maroon", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>7999, :newused=>"Used", :vin=>"5N1AN08UX7C508526", :stocknumber=>"ACSJ168", :model=>"Xterra", :trim=>"S", :enginedescription=>"4L 6 Cylinders", :interiorcolor=>"Gray", :options=>"(10) Tie-Down Points-Inc: (6) Cargo Area Utility Hooks, (4) Adjustable Cleats,(4) 12-Volt Dc Pwr Outlets (2 Live),Audio : Am/Fm Stereo,Audio : Cd Player,Convenience : Intermittent Wipers,Convenience : Luggage Rack,Convenience : Power Outlet,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows W/Driver Auto-Down,Rear Stadium Seating W/Raised Roofline,Rear Window Defroster,Vehicle Security System W/Immobilizer,Window : Privacy Glass,Window : Rear Defrost", :imagefront=>nil, :imageback=>nil, :imageleft=>nil, :imageright=>nil, :frontinterior=>nil, :rearinterior=>nil, :bodytype=>nil, :make=>"Nissan", :approved=>true, :expiration_date=>"2218-01-03 01:44:43", :external_url=>true, :external_image=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181046638_d4a4f7439987498180eb92eccc01dc18.jpg", :external_imagefront=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181046927_e1ad4085464a4b96a6a4214890813ba2.jpg", :external_imageback=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181047322_49d72ee517344e33a2d7f2907700f23f.jpg", :external_imageleft=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181048112_8fc4a188d89741b48d94afcb32ba9ae1.jpg", :external_imageright=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181048274_5eb177aa84b84ebb98ce82f45f214ada.jpg", :external_frontinterior=>"http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181048530_1957f113fe254d619a8d832521d6716a.jpg", :external_rearinterior=>"http://images.dealersync.com/cloud/userdocumentprod/238