Listing.where(vin: '5N1ED28T22C553945').first.update(:title=>"2002 Nissan Xterra", :description=>"Our 2002 Nissan Xterra XE is a compact SUV with an emphasis on both Sport and Utility unlike the SMVs (soccer mom vehicles) or GHVs (grocery hauling vehicles) that most of the current crop of SUVs have morphed into. This baby can do those too - but it can handle the rugged off-road side as well.\u00C2\u00A0   This sporty little beast of burden is just as comfortable on the highway as it is on back country roads!\u00C2\u00A0 Plus, it also has the rugged reliability that keeps it rolling no-matter the miles it's eaten!   Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! END OF MARCH BOTTOM LINE CASH DEALS PRICES EXPIRE APRIL 1ST NO FOOLIN", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2002, :miles=>136224, :transmission=>"Automatic", :color=>"Silver Ice Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4999, :newused=>"Used", :vin=>"5N1ED28T22C553945", :stocknumber=>"LCSJ127", :model=>"Xterra", :trim=>"XE", :enginedescription=>"3.3L 6 Cylinders", :interiorcolor=>"Gray", :options=>"(4) Cargo Floor Tie-Down Hooks,3-Point Front Seat Belts W/Height Adjusters, Pretensioners/Load Limiters,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Audio : Am/Fm Stereo,Audio : Cd Player,Child Safety Rear Door Locks,Convenience : Power Outlet,Driver & Front Passenger Dual Stage Airbags,Latch Child Safety Seat System-Inc: Lower Anchors, Tether,Rear Window Defroster,Safety Features : Child Safety Locks,Seats : Bucket Seats,Seats : Rear Bench Seat,Window : Privacy Glass", :imagefront=>nil, :imageback=>nil, :imageleft=>nil, :imageright=>nil, :frontinterior=>nil, :rearinterior=>nil, :bodytype=>nil, :make=>"Nissan", :approved=>true, :expiration_date