Listing.where(vin: '5GZCZ63BX2S830817').first.update(:title=>"2002 Saturn VUE", :description=>"Check out our Clean Carfax 2002 Saturn VUE AWD in Black Silver! Saturn created the Vue for drivers and families who want a manageable, but highly functional, sport-utility, one that can haul plenty of gear without requiring huge parking spaces and a big garage. Our All Wheel Drive Vue is powered by a 3.0L V6 engine getting up to 25mpg on the open road.  Getting inside is easy, thanks to wide door openings. This one has loads of great features... A 70/30 split folding rear seat provides more versatile stowage of longer items while carrying rear passengers. Even the front passenger seat folds flat, allowing room for an eight-foot ladder or a surfboard. Front and rear power outlets provide opportunities to plug in toys or tools. Did you see the Sunroof?  Over all, this is a great SUV in terms of build quality, fuel economy, and functionality. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2002, :miles=>86495, :transmission=>"Automatic", :color=>"Black Silver", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4999, :newused=>"Used", :vin=>"5GZCZ63BX2S830817", :stocknumber=>"DCSJ038", :model=>"VUE", :trim=>nil, :enginedescription=>"3L 6 Cylinders", :interiorcolor=>"Grey", :options=>"Audio : Cd Player,Brake/Transmission Interlock,Breakaway Inside Rearview Mirror,Child-Security Rear Door Locks,Convenience : Fog Lamps,Convenience : Power Outlet,Convenience : Security System,Driver & Front Passenger Airbags,Locks : Keyless Entry,Locks : Power Door Locks,Mirrors : Power Mirror(S),Pwr Windows W/Driver-Side Exp