Listing.where(vin: '2T1BU4EE3BC747304').first.update(:title=>"2011 Toyota Corolla", :description=>"Take a peek at our 2011 Toyota Corolla LE Sedan presented in beautiful Magnetic Gray Metallic. Beneath the stylish hood of this spirited Front Wheel Drive sedan is a 1.8 Liter 4 Cylinder that offers 132hp on demand while mated to a stable 4 Speed Automatic transmission. This perfect combination helps you reach near 35mpg on the open highway and is perfect for your daily commute. It is no secret that the Corolla ranks as one of the best-selling cars of all time!   This Corolla offers coziness, simple controls, and a quiet cabin. A perfect balance of efficiency and style, it has an attractive interior that offers comfortable seats with technology that is straightforward and user-friendly. The instrument panel is bright and easy to see, especially at night. Full power accessories, power driver and passenger seats, and a 60/40-split-folding rear seat make life more convenient. The trip computer and 6 speaker sound system with a CD player and an auxiliary audio jack are great for those long trips.  With stability control, anti-lock brakes and airbags, you can rest assured that you and your passengers will be kept safely out of harm's way. Driving this car may be the best decision you've made all year! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2011, :miles=>47633, :transmission=>"Manual", :color=>"Magnetic Gray Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>8999, :newused=>"Used", :vin=>"2T1BU4EE3BC747304", :stocknumber=>"CAVQ178", :model=>"Corolla", :trim=>"L", :enginedescription=>"